   document.addEventListener('DOMContentLoaded', () => {
       const texts = ["Minecraft", "Roblox", "Unity", "Scratch", "Python"];
       const textElement = document.querySelector('.animattion-section');
       let currentIndex = 0;
       let charIndex = 0;
       const typingSpeed = 150;  // скорость печатания
       const erasingSpeed = 100;  // скорость стирания
       const delayBetweenTexts = 1000;  // задержка между текстами

       function type() {
           if (charIndex < texts[currentIndex].length) {
               textElement.textContent += texts[currentIndex][charIndex];
               charIndex++;
               setTimeout(type, typingSpeed);
           } else {
               setTimeout(erase, delayBetweenTexts);
           }
       }

       function erase() {
           if (charIndex > 0) {
               textElement.textContent = texts[currentIndex].substring(0, charIndex - 1);
               charIndex--;
               setTimeout(erase, erasingSpeed);
           } else {
               currentIndex = (currentIndex + 1) % texts.length;
               setTimeout(type, typingSpeed);
           }
       }

       type(); // Начать анимацию
   });

